import React from "react";   
import dbMaterial from "./dbMaterial.js";

function Material() {

    const handleClick = (e) => {
        alert("Handled Click");
    }

    return(
        <div className="material">
        { dbMaterial.map( (mat, index) => (
            <div className="material-item" onClick={(e)=>handleClick(e)}>
                <p>{mat.nome}</p>
            </div>
          ))
        }
        </div>
    )
}


export default Material;
